import React from 'react';
import { FaBars } from 'react-icons/fa';
import {Nav, NavbarContainer, NavLogo, NavMenu} from './NavbarElements';

const Navbar = () => {
  return (
    <>
      <Nav>
          <NavbarContainer>
            <NavLogo to="/">
                <img src={require('../../images/splendi_logo_convert.svg').default} 
                />
            </NavLogo>
            <MobileIcon>
                <FaBars />
            </MobileIcon>


          </NavbarContainer>

        </Nav>

    </>
  )
}

export default Navbar;
